['#include <stdio.h>

// ham dem so luong nho nhat trong k2 k5 k6
int min3So(int a, int b, int c){
	int min = a;
	if (b < min) min = b;
	if (c < min) min = c;
	return min;
}
// ham dem so luong nho hon k2(con lai) k3
int min2So(int a, int b){
	if (a < b) return a;
	else return b;
}

int main(){
	int k2, k3 , k5, k6;
	scanf ("%d%d%d%d", &k2, &k3, &k5, &k6);
	int m = min3So(k2, k5, k6); // so luong so 256
	int n = min2So(k2-m, k3); // so luong so 32
	printf ("%d", m*256 + n*32);
	return 0;
}
']

