['// Anton likes to play chess, and so does his friend Danik.
// 
// Once they have played n games in a row. For each game it's known who was the
// winner — Anton or Danik. None of the games ended with a tie.
// 
// Now Anton wonders, who won more games, he or Danik? Help him determine this.
// 
// Input
// The first line of the input contains a single integer n
// (1 ≤ n ≤ 100 000) — the number of games played.
// 
// The second line contains a string s, consisting of n uppercase English
// letters 'A' and 'D' — the outcome of each of the games. The i-th character
// of the string is equal to 'A' if the Anton won the i-th game and 'D' if
// Danik won the i-th game.
// 
// Output 
// If Anton won more games than Danik, print "Anton" (without quotes) in
// the only line of the output.
// 
// If Danik won more games than Anton, print "Danik" (without quotes) in the
// only line of the output.
// 
// If Anton and Danik won the same number of games, print "Friendship" (without
// quotes).

#include <stdio.h>

#define LENGTH 200000

int main(void) {


    int numGames;
    scanf("%d", &numGames);

    char result[LENGTH];
    result[0] = '\0';
    scanf("%s", result);

    int a = 0;
    int d = 0;

    int i = 0;
    while (result[i] != '\0' && i < numGames) {
        if (result[i] == 'A') {
            a++;
        } else if (result[i] == 'D') {
            d++;
        }
        i++;
    }

    if (a > d) {
        printf("Anton\n");
    } else if (a < d) {
        printf("Danik\n");
    } else if (a == d) {
        printf("Friendship\n");
    } else {
        // Because why not!
        printf("Why is this condition even here lmao\n");  
    }
    
    return 0;
}
