['#include <stdio.h>

int min3(int a, int b, int c)
{
    if(a<=b&&a<=c)
        return a;
    if(b<=a&&b<=c)
        return b;
    if(c<=a&&c<=b)
        return c;
}

int min2(int a, int b)
{
    return a< b?a:b;
}

int main()
{
    int k2, k3, k5, k6;
    scanf("%d%d%d%d", &k2, &k3, &k5, &k6);
    int e=min3(k2,k5,k6);
    int nr=e*256+min2(k3, k2-e)*32;
    printf("%d\n", nr);
    return 0;
}
']

